// import logo from './logo.svg';
// import logo1 from './assets/globeboarding-transparent.png'
import mountain from './assets/background-mountain.mp4'
import './App.css';

function App() {

  let headerPage =       
  <header className="App-header">
    {/* <img src={mountain} alt="logo" /> */}
    <video autoPlay muted> 
      <source> src={mountain} type="video/mp4" </source>
    </video>
    <p>
      Edit <code>src/App.js</code> and save to reload. yo
    </p>
    <a
      className="App-link"
      href="https://reactjs.org"
      target="_blank"
      rel="noopener noreferrer"
    >
      Learn React
    </a>
</header>

let bodyPage =  
<body> 
  <h1>Globeboarding</h1>
</body>


  return (
    <div className="App">
        {headerPage}
        {bodyPage}
    </div>
  );
}

export default App;
